import React from "react";
import Nav, { Li, Sidebar, Content } from "../navbar/Nav";
import { useDispatch } from "react-redux";
import { userActions } from "../../store/user-slice";
import { CgProfile } from "react-icons/cg";
import { AiFillEdit } from "react-icons/ai";

function TeacherNav(props) {
  const dispatch = useDispatch();

  function logoutHandler() {
    dispatch(userActions.logout());
  }
  return (
    <Nav>
      <Sidebar header="Menu">
        <Li to="/teacher/profile" icon={CgProfile}>
          Profile
        </Li>
        <Li to="/teacher/edit-classes" icon={AiFillEdit}>
          Edit Classes
        </Li>
        <Li to="/teacher/create-class" icon={CgProfile}>
          Create Class
        </Li>
        <Li to="/teacher/add-subject" icon={CgProfile}>
          Add Subject
        </Li>
        <Li to="/teacher/announcement" icon={CgProfile}>
          Announcement
        </Li>
        <Li to="/teacher/year" icon={CgProfile}>
          Start Year
        </Li>
        <Li onClick={logoutHandler} to="/login" icon={CgProfile}>
          Logout
        </Li>
      </Sidebar>
      <Content>{props.children}</Content>
    </Nav>
  );
}

export default TeacherNav;
